import React from 'react';

function ServiceCard(props){
	return(
		<div className='ServiceCatagoryCard ServiceCard'>
			<div>
				<img src={props.Image} alt='service'/>
				<div>
					<h4>Type</h4>
				</div>
			</div>
		</div>
	);
}

export default ServiceCard;
